  methods: {
    loadNode(node, resolve) {
      if (node.level === 0) {
        return resolve([{ title: 'region' }]);
      }
      if (node.level > 1) return resolve([]);

      setTimeout(() => {
        const data = [{
          title: 'leaf',
          leaf: true
        }, {
          title: 'zone'
        }];

        resolve(data);
      }, 1500);
    },
    handleContextMenu (data) {
      this.contextData = data
    },
    handleContextMenuEdit () {
      console.log('Click edit of' + this.contextData.title)
    },
    handleContextMenuDelete () {
      console.log('Click delete of' + this.contextData.title)
    },
    renderTree (h, { node, data, store }) {
      if (data.type === 'NODE') {
        return h('span', {
          style: {
            display: 'inline-block',
            width: '100%'
          }
        }, [
          h('span', {
            class: 'double',
            on: {
              dblclick: () => {
                console.log('双击 ' + data.type)
              }
            }
          }, [
            h('i', {
              class: `node-icon icon-${data.taskType}`,
              style: {
                marginRight: '8px'
              }
            }),
            h('span', {
              class: 'node-title'
            }, data.title)
          ])
        ])
      } else {
        return h('span', {
          style: {
            display: 'inline-block',
            width: '100%'
          }
        }, [
          h('span', {
            class: 'double',
            on: {
              dblclick: () => {
                console.log('双击 ' + data.type)
              }
            }
          }, [
            h('i', {
              class: data.type === 'FOLDER' ? 'ans-icon-folder-empty' : 'ans-icon-node',
              style: {
                marginRight: '8px'
              }
            }),
            h('span', {
              class: 'node-title'
            }, data.title)
          ])
        ])
      }
    }
  },
